import { Link } from "react-router-dom";

const EVENTS = [
  { id: "1", title: "Event 1" },
  { id: "2", title: "Event 2" },
  { id: "3", title: "Event 3" },
];

export default function EventPage() {
  return (
    <>
      <h1>Event page</h1>
      <ul>
        {EVENTS.map((e) => {
          return (
            <li key={e.id}>
              <Link to={`${e.id}`}>{e.title}</Link>
            </li>
          );
        })}
      </ul>
    </>
  );
}
